    url = encloseURI(url);

    if (token.title) {
        url += SPACE + encloseTitle(self.encode(token.title, token));
    }

    value = SQUARE_BRACKET_OPEN + value + SQUARE_BRACKET_CLOSE;

    value += PARENTHESIS_OPEN + url + PARENTHESIS_CLOSE;

    return value;
